import React from 'react';
import NumberPresenter from './NumberPresenter';

const Test = () => {
  const input = [5, [-8, "/", 1, "/", 6, "/", 8]];

  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold mb-4">Test Page</h1>
      <NumberPresenter base={input[0]} exponentsAndOperators={input[1]} />
    </div>
  );
};

export default Test;
